import React from 'react';

function StockChart() {
  return (
    <div className="stock-chart">
      <div className="stock-info">
        <option>Mã CK: 
            <div>VN30F2501</div>
        </option>
        <div>Ngày DH: 12-04-2024</div>
        <div>Trần: <span className="price-blue">1,220.3</span></div>
        <div>Sàn: <span className="price-blue">950.0</span></div>
        <div>T/C: <span className="price-yellow">1,050.0</span></div>
        <div>Giá khớp: <span className="price-yellow">1,050.0</span></div>
        <div>KL khớp: --</div>
        <div>+/-: 0.00</div>
        <div>+/- (%): 0.00%</div>
      </div>
      <div className="chart-placeholder">
        {/* Bạn có thể thay bằng chart thư viện như Chart.js hoặc Recharts */}
        <p>Biểu đồ giá (Chart)</p>
      </div>
    </div>
  );
}

export default StockChart;
